function DisplayExpenses(props) {
    const title = props.title; 
    const amount = props.amount;
    const date = props.date
  return (
    <div>
      <div>{props.title}</div>
      <div>{props.amount}</div>
      <div>{props.date}</div>
    </div>
  );
}

export default DisplayExpenses;
